import { Menu } from "antd";
import './Menu.css';

export default function MainComponent(props) {     

    return (
        <div>   
        <Menu items={[
            {label: "DashBoard"},
            {label: "User"},
            {label: "Etc"},
            {label: "Salir"},
        ]}>
        </Menu>
        </div>
    );
  }
